import { Link } from 'react-router-dom';

const CourseList = ({ courses }) => {
  return (
    <div className='mt-10'>
      {this.props.data
        .filter((course, idx) => idx < 5)
        .courses.map((course) => (
          <div
            className='p-2.5 mt-5 mx-10 border border-gray-500 rounded-xl shadow-listShadow
            hover:cursor-pointer hover:shadow-lg'
            key={course.id}
          >
            <Link to={`/courses/${course.id}`}>
              <h2 className='text-xl font-bold mb-3'>{course.Монгол_нэр}</h2>
              <p>{course.Зорилго}</p>
            </Link>
          </div>
        ))}
    </div>
  );
};

export default CourseList;
